package com.fis.fw.core.entity;import javax.persistence.*;import java.util.Date;@Entity@Table(name = "LOG_SESSION", schema = "ADMIN_DTHGD")public class LogSession {    private static final long serialVersionUID = 1L;    @Id    @Column(name = "LOG_SESSION_ID")    @GeneratedValue(strategy = GenerationType.SEQUENCE, generator = "LOG_SESSION_SEQ")    @SequenceGenerator(schema = "ADMIN_DTHGD", sequenceName = "LOG_SESSION_SEQ", name = "LOG_SESSION_SEQ", allocationSize = 1)    private Integer logSessionId;    @Column(name = "USER_ID")    private Integer userId;    @Column(name = "CREATE_TIME")    private Date createTime;    @Column(name = "TOKEN")    private String token;    @Column(name = "IP_ADDRESS")    private String ipAddress;    public LogSession() {    }    public LogSession(Integer userId, String ipAddress, String token) {        this.userId = userId;        this.ipAddress = ipAddress;        this.token = token;        this.createTime = new Date();    }    public LogSession(Integer userId, String ipAddress) {        this.userId = userId;        this.ipAddress = ipAddress;        this.createTime = new Date();    }    public void setLogSessionId(Integer logSessionId) {        this.logSessionId = logSessionId;    }    public void setUserId(Integer userId) {        this.userId = userId;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public void setToken(String token) {        this.token = token;    }    public void setIpAddress(String ipAddress) {        this.ipAddress = ipAddress;    }    public Integer getLogSessionId() {        return logSessionId;    }    public Integer getUserId() {        return userId;    }    public Date getCreateTime() {        return createTime;    }    public String getToken() {        return token;    }    public String getIpAddress() {        return ipAddress;    }}